import moment from "moment";
import puppeteer from "puppeteer";

export const createPdf = async (req: any, html: string) => {
  const browser = await puppeteer.launch({
    headless: true,
  });

  const page = await browser.newPage();

  const htmlLayout =
    "<div style='padding: 20px; font-family:Arial; font-size:13px'><img style='display:block; padding: 20px 0 20px 0; width:200px;height:auto' src='data:image/png;base64,'/>" +
    "<p style='font-size:14px;font-weight:bold'>Client Details:<p>" +
    "<p>First Name: <strong>" +
    req.body.firstName +
    "</strong><p>" +
    "<p>Last Name: <strong>" +
    req.body.lastName +
    "</strong><p>" +
    "<p>Email: <strong>" +
    req.body.email +
    "</strong><p>" +
    "<p>Mobile: <strong>" +
    req.body.mobile +
    "</strong><p>Passport/ID No: <strong>" +
    req.body.passportId +
    "</strong><p>" +
    "<p><br/>" +
    html +
    "<br/><p>Accepted the terms above on the <strong>" +
    moment().format("YYYY-MM-DD HH:mm:ss") +
    "</strong></p>";
  ("</div>");

  await page.setContent(htmlLayout, {
    waitUntil: "domcontentloaded",
  });
  const pdfPath =
    process.env.APP_ENV === "production"
      ? `${process.env.RAILWAY_VOLUME_MOUNT_PATH}` +
        req.body.firstName +
        "_document.pdf"
      : "./pdf/" + req.body.firstName + "_document.pdf";
  // let pdfPath =
  //   `${process.env.RAILWAY_VOLUME_MOUNT_PATH}` +
  //   req.body.firstName +
  //   "_document.pdf";
  //let pdfPath = "./pdf/" + req.body.firstName + "_document.pdf";

  const pdf = await page.pdf({
    format: "A4",
    path: pdfPath,
  });

  await browser.close();
  return pdfPath;
};
